import React from 'react';

function MainSection() {
  return (
    <section id="main" className="main-section">
      <h2>Исследуйте космос с нами</h2>
      <p>Откройте новые горизонты вместе с нами. Мы предлагаем передовые решения для космических исследований и инновационных технологий.</p>
    </section>
  );
}

export default MainSection;
